@import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@100;300;400;500;700;900&family=Poppins:wght@300;400;500;600;700&display=swap');

.kor {
  font-family: 'Noto Sans KR', sans-serif;
}

.eng {
  font-family: 'Poppins', sans-serif;
}

$color : #FD8234;



/* ----------------------- main ----------------------- */
.main {
  width: 100%;
  height: auto;
  margin-top: 105px;

  .swiper_main {
    width: auto;
    height: calc(100vh - 105px);
    margin: 0 auto;

    &:hover .swiperBtn {
      visibility: visible;
      transition: all 0.3s ease;
    }

    .swiper-wrapper {
      width: auto;
      height: calc(100vh - 105px);

      .swiper-slide {
        width: auto;
        height: calc(100vh - 105px);
        display: flex;
        justify-content: center;
        align-items: center;

        img {
          width: 100%;
          height: 100%;
          object-fit: cover;
        }
      }
    }

    .swiper-pagination {
      .swiper-pagination-bullet {
        width: 9px;
        height: 9px;
        background-color: white;
        margin-bottom: 20px;
      }

      .swiper-pagination-bullet-active {
        background-color: $color;
        width: 20px;
        height: 10px;
        border-radius: 10px;
        transition: all 0.3s ease;
      }
    }

    .swiperBtn {
      margin-top: 20px;
      visibility: hidden;
    }

    .swiperBtn:after {
      color: $color;
      padding: 10px;
      font-size: 30px;
      font-weight: bold;
    }
  }


  /* ----------------------- new_arrivals ----------------------- */
  .new_arrivals {
    width: 100vw;
    height: auto;
    position: relative;

    h1 {
      text-align: center;
      padding: 10px 0;
      margin: 70px 0 50px;
    }

    .swiper_new {
      width: 1180px;
      height: auto;
      margin: 0 auto;

      .swiper-wrapper {
        width: 1180px;
        height: auto;

        .swiper-slide {
          width: 360px;
          height: 360px;
          margin-bottom: 50px;
          display: flex;
          justify-content: center;
          align-items: center;

          &:nth-child(3) {
            margin-right: 0;
          }

